import React from 'react'
import { Progress } from '../../Left/LeftBody/ProgresBar/CircualProgres'

function PerOvalSkills({ strokeWidth,prosentage}) {
    const Cprogress = [...strokeWidth,pros]
    return (
        <div className="TM_Left_scrolbar_skills px-2 d-flex justify-content-between">
                {Cprogress.map(e => (
                    <div className="TM_Left_scrolbar_skills_item d-flex flex-column align-items-center" key={e.Ltype}>
                        <Progress width={90} strokeWidth={5} percentage={e.percentage} key={e.percentage} />
                        <h6 className="mt-2">{e.Ltype}</h6>
                    </div>
                ))}
        </div>
    )
}

export default PerOvalSkills
